// Pileup inverse of combinatorial compound Poisson problem,
// based on a closed form incidence algebra solution (solution by M. Mieskolainen)
//
/*

// ----------------------------------------------------------------------
EXAMPLE of USAGE:

// Ground truth probabilities of mutually exclusive combinations.
// N = 3 (three detectors) (000, 001, 010, 011, 100, 101, 110, 111)
// Make sure 0-th component is zero (it is unvisible)
std::vector<double> p = {
	0.0,
	0.040079021973800,
	0.050471072739824,
	0.222838163465361,
	0.173554170276039,
	0.218088208991535,
	0.164300170447909,
	0.130669192105532};

// Global OR trigger occupancy rate between (0...1], global OR between
// N different detectors involved in the vector rates
double R = 0.1;

PileUp pu;
std::vector<double> y    = pu.Map("Forward", p, R); // Direct pileup
std::vector<double> phat = pu.Map("Inverse", y, R); // Invert pileup
// -----------------------------------------------------------------------

*/
//
// One can easily wrap statistical uncertainty estimation around this,
// using e.g. Efron's bootstrap on the measured event counts:
// 
// for 1 ... Repetitions
//   1. Draw a new sample of 2^N vector rates according
//      to the collected count (multinomial) statistics
//   2. Run this class
// end
//   Calculate confidence intervals
//
// See VecOper.cc for bootstrap functions.
//
//
