std::vector<double> PileUp::MapCounts(const std::string& type, const std::vector<double>& input, double R) {

	const double mu = GetMu(R);
	const int N = std::round( std::log2(input.size()) );

	if (VERBOSE) {
		printf("\nPileUp::MapCounts::\ntype<%s> N = %d, R = %0.5f <=> Poisson mu = %0.5f \n", type.c_str(), N, R, mu);
		printf("positivity = %d\n", ENFORCE_POSITIVITY);
	}

	// remove 0-th and make a normalized vector length of 2^N-1
	std::vector<double> y(input.size()-1, 0.0);
	for (uint i = 0; i < y.size(); ++i) {
		y.at(i) = input.at(i+1);
	}
	const double YSUM = VecOper::vsum(y); // Save the sum
	y = VecOper::nvec(y); 		          // Normalize sum to 1 -> probability density

	// [1.] LAMBDA * y
	std::vector<double> z = MatVecProd(A[N], y);

	std::vector<double> r(z.size(), 0.0);

	// [2.] Exponential map
	if (type.compare("Inverse") == 0) {
		for (uint i = 0; i < z.size(); ++i) { // Invert, for correcting pileup
			r.at(i) = std::log((std::exp((-1.0)*mu) - 1.0)*z.at(i) + 1.0) / ((-1.0)*mu);
		}
	}
	else if (type.compare("Forward") == 0) {  // Forward, for simulating pileup
		for (uint i = 0; i < z.size(); ++i) {
			r.at(i) = (std::exp((-1.0)*mu * z.at(i)) - 1.0) / (std::exp((-1.0)*mu) - 1.0);
		}
	}
	else {
		printf("PileUp::Map:: Error, unknown operation type: %s \n", type.c_str());
	}

	// [3.] LAMBDA^{-1} * r
	std::vector<double> phat = MatVecProd(invA[N], r);

	// Add 0-th component, scale to the original event count
	std::vector<double> output(input.size(), 0.0);
	for (uint i = 1; i < output.size(); ++i) {
		output.at(i) = phat.at(i-1)*YSUM;

		// Do we constraint positivity
		if (ENFORCE_POSITIVITY)
			output.at(i) = (output.at(i) < 0) ? 0 : output.at(i);
	}
	
	// Print comparison
	if (VERBOSE) {
		PrintComparison(input, output);
	}

	return output;
}


// Print out two vectors side by side
void PileUp::PrintComparison(const std::vector<double>& a, const std::vector<double>& b) {

	printf("PileUp::PrintComparison:: \n\n");
	for (uint i = 0; i < a.size(); ++i) {
		printf("%03d, input = %0.1f \t\t output = %0.1f \n", i, a.at(i), b.at(i));
	}
	printf("\n");
}



// Rate to Poisson mu-value function
// input R is [0,1) global OR trigger "occupancy"
// = #trigger/#number-of-bunch-crosses
double PileUp::GetMu(double R) {

	return -std::log(1.0 - R);
}

// Matrix-Vector product
std::vector<double> PileUp::MatVecProd(const std::vector<std::vector<double> >& M, const std::vector<double>& x) {

	std::vector<double> y(M.size(), 0.0);

	for (uint i = 0; i < M.size(); ++i) {
		for (uint j = 0; j < M.at(i).size(); ++j) {

			y.at(i) += M.at(i).at(j) * x.at(j);
		}
	}
	return y;
}

